<meta charset="utf-8">

<Script>

function mostra(texto){

    document.write(texto);
    document.write("<br>");
    
}

var inicial= 30;
var final = 40;

while ( inicial <= final){

    if(inicial ==33 || inicial == 37){

    inicial=inicial+1;

    }else{

    mostra(inicial);
    inicial=inicial+1;

    }

   
}mostra("fim");



</Script>
